{"operationName":"products","variables":{"productIds":["50043737","50122578","50050250","50124658","50124657","50126509","50050949","50128230","50051276","50044523","50051735","50126561"]},"query":"query products($productIds: [String]!) {
  products(productIds: $productIds) {
    productId
    name {
      cyrillic
      latin
      __typename
    }
    rating {
      star
      count
      __typename
    }
    media {
      images {
        key
        urls
        __typename
      }
      __typename
    }
    features {
      main {
        name
        value
        __typename
      }
      energyEfficiency {
        name
        value
        __typename
      }
      __typename
    }
    brand {
      name
      __typename
    }
    categories {
      id
      name
      __typename
    }
    __typename
  }
}
